import React, { Component } from 'react'

export default class logout extends Component {
  logout = () => {
    localStorage.clear();
// you can also like localStorage.removeItem('Token');
    window.location.href = "/login";
  }
 
  render() {
    return (
      <button onClick={this.logout}>Logout</button>
    )
  }
}
